import React from 'react'
import ToDoItem from '../ToDoItem/ToDoItem';


export default function ToDoList({StatusDone}) {




  return (
    <div>
       
        {
        ToDoItem.map(el => <ToDoItem {...el} key={el.id} {...{StatusDone}}/>)
        }
       
    </div>
  )
}
